import React from 'react'
import Card from 'react-bootstrap/Card';
import './Content.css'


function Content(props){
    return(
      <div id="card">
       <Card style={{ width: '18rem' }}>
      <Card.Body>
        <Card.Title>{props.title}</Card.Title>
        <Card.Text>
          {props.content}
        </Card.Text>
      </Card.Body>
    </Card>
    </div>
        )
}

export default Content
